INSERT INTO `tools` VALUES ('1', '/urlEncode', '/WEB-INF/jsp/utils/url_encode.jsp', '在线URL编码转换工具', 'URL编码遵循下列规则： 每对name/value由&；符分开；每对来自表单的name/value由=符分开。如果用\r\n解码软件\r\n解码软件\r\n户没有输入值给这个name，那么这个name还是出现，只是无值。任何特殊的字符（就是那些不是简单的七位ASCII，如汉字）将以百分符%用十六进制编码，当然也包括象 =,&；，和 % 这些特殊的字符。其实url编码就是一个字符ascii码的十六进制。不过稍微有些变动，需要在前面加上“%”。比如“\\”，它的ascii码是92，92的十六进制是5c，所以“\\”的url编码就是%5c。那么汉字的url编码呢？很简单，看例子：“胡”的ascii码是-17670，十六进制是BAFA，url编码是“%BA%FA”。', 'http://blog.51duobei.com/upload/diy/url.jpg');
INSERT INTO `tools` VALUES ('2', '/ipQuery', '/WEB-INF/jsp/utils/ip_query.jsp', 'IP地址查询', '因特网是全世界范围内的计算机连为一体而构成的通信网络的总称。连在某个网络上的两台计算机之间在相互通信时，在它们所传送的数据包里都会含有某些附加信息，这些附加信息其实就是发送数据的计算机的地址和接受数据的计算机的地址。人们为了通信的方便给每一台计算机都事先分配一个类似我们日常生活中的电话号码一样的标识地址，该标识地址就是IP地址。', 'http://blog.51duobei.com/upload/diy/ip.jpg');
INSERT INTO `tools` VALUES ('3', '/baseEncode', '/WEB-INF/jsp/utils/base_encode.jsp', '在线Base64加密解密', 'Base64是网络上最常见的用于传输8Bit字节代码的编码方式之一，大家可以查看RFC2045～RFC2049，上面有MIME的详细规范。Base64编码可用于在HTTP环境下传递较长的标识信息。例如，在Java Persistence系统Hibernate中，就采用了Base64来将一个较长的唯一标识符（一般为128-bit的UUID）编码为一个字符串，用作HTTP表单和HTTP GET URL中的参数。在其他应用程序中，也常常需要把二进制数据编码为适合放在URL（包括隐藏表单域）中的形式。此时，采用Base64编码具有不可读性，即所编码的数据不会被人用肉眼所直接看到。', 'http://blog.51duobei.com/upload/diy/base64.jpg');
INSERT INTO `tools` VALUES ('4', '/jsonFormat', '/WEB-INF/jsp/utils/json_format.jsp', 'JSON在线格式化', 'JSON(JavaScript Object Notation) 是一种轻量级的数据交换格式。它基于ECMAScript的一个子集。 JSON采用完全独立于语言的文本格式，但是也使用了类似于C语言家族的习惯（包括C、C++、C#、Java、JavaScript、Perl、Python等）。这些特性使JSON成为理想的数据交换语言。 易于人阅读和编写，同时也易于机器解析和生成(一般用于提升网络传输速率)。', 'http://blog.51duobei.com/upload/diy/json.jpg');
INSERT INTO `tools` VALUES ('5', '/urlShort', '/WEB-INF/jsp/utils/url_short.jsp', '在线短网址生成', '短网址（Short URL） ，顾名思义就是在形式上比较短的网址。通常用的是asp或者php转向，在Web 2.0的今天，不得不说，这是一个潮流。目前已经有许多类似服务，借助短网址您可以用简短的网址替代原来冗长的网址，让使用者可以更容易的分享链接。', 'http://blog.51duobei.com/upload/diy/duanwangzhi.jpg');
INSERT INTO `tools` VALUES ('6', '/md5Encode', '/WEB-INF/jsp/utils/md5_encode.jsp', '在线MD5加密解密', 'MD5的全称是Message-Digest Algorithm 5（信息-摘要算法），在90年代初由MIT Laboratory for Computer Science和RSA Data Security Inc的Ronald L. Rivest开发出来，经MD2、MD3和MD4发展而来。', 'http://blog.51duobei.com/upload/diy/md5.jpg');
